# AD Account Unlock
# By Jesse Kozeluh
# Date 6/8/24
# Version 3.0

# Base64 string of the icon
$iconBase64 = "
"

# Convert the base64 string back to an icon
$iconBytes = [Convert]::FromBase64String($iconBase64)
$stream = [System.IO.MemoryStream]::new($iconBytes, 0, $iconBytes.Length)
$icon = [System.Drawing.Icon]::FromHandle(([System.Drawing.Bitmap]::new($stream).GetHIcon()))

# Gets accounts currently locked
$LockedOut = Search-ADAccount -LockedOut -UsersOnly | Select Name, SamAccountName

# Draws UI elements
Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing

$form = New-Object System.Windows.Forms.Form
$form.Text = 'AD Account Unlock'
$form.Size = New-Object System.Drawing.Size(400, 300)
$form.StartPosition = 'CenterScreen'
$form.icon = $icon

$label = New-Object System.Windows.Forms.Label
$label.Location = New-Object System.Drawing.Point(10, 20)
$label.Size = New-Object System.Drawing.Size(280, 20)
$label.Text = 'Select account(s):'
$form.Controls.Add($label)

$listBox = New-Object System.Windows.Forms.ListBox
$listBox.Location = New-Object System.Drawing.Point(10, 40)
$listBox.Size = New-Object System.Drawing.Size(360, 180)
$listBox.SelectionMode = [System.Windows.Forms.SelectionMode]::MultiSimple

# Styling
$form.BackColor = [System.Drawing.Color]::White  # Set the background color
$label.ForeColor = [System.Drawing.Color]::Black  # Change label text color
$listBox.ForeColor = [System.Drawing.Color]::Black  # Change listbox text color

# Create a hashtable to store Name and SamAccountName
$userHashTable = @{}

# Function to populate the listbox
function Populate-ListBox {
    $listBox.Items.Clear()
    $LockedOut = Search-ADAccount -LockedOut -UsersOnly | Select Name, SamAccountName
    foreach ($user in $LockedOut) {
        [void]$listBox.Items.Add($user.Name)
        $userHashTable[$user.Name] = $user.SamAccountName
    }
}

# Initial population of the listbox
Populate-ListBox

$form.Controls.Add($listBox)

$okButton = New-Object System.Windows.Forms.Button
$okButton.Location = New-Object System.Drawing.Point(75, 230)
$okButton.Size = New-Object System.Drawing.Size(75, 23)
$okButton.Text = 'Unlock'
$okButton.ForeColor = [System.Drawing.Color]::Black
$okButton.Add_Click({
    foreach ($selectedItem in $listBox.SelectedItems) {
        $samAccountName = $userHashTable[$selectedItem]
        Unlock-ADAccount -Identity $samAccountName
        Write-Host "Account unlocked: $selectedItem ($samAccountName)" -BackgroundColor Cyan -ForegroundColor Black
    }
        Populate-ListBox
})
$form.Controls.Add($okButton)

$cancelButton = New-Object System.Windows.Forms.Button
$cancelButton.Location = New-Object System.Drawing.Point(150, 230)
$cancelButton.Size = New-Object System.Drawing.Size(75, 23)
$cancelButton.Text = 'Cancel'
$cancelButton.ForeColor = [System.Drawing.Color]::Black
$cancelButton.DialogResult = [System.Windows.Forms.DialogResult]::Cancel
$form.CancelButton = $cancelButton
$form.Controls.Add($cancelButton)

$refreshButton = New-Object System.Windows.Forms.Button
$refreshButton.Location = New-Object System.Drawing.Point(225, 230)
$refreshButton.Size = New-Object System.Drawing.Size(75, 23)
$refreshButton.Text = 'Refresh'
$refreshButton.ForeColor = [System.Drawing.Color]::Black
$refreshButton.Add_Click({
    Populate-ListBox
})
$form.Controls.Add($refreshButton)

$form.Topmost = $true
$form.ShowDialog()
